import React, { Component } from 'react'
import MediaPlayer from '../MediaPlayer/Media-Player'


class Results extends Component {
    constructor() {
        super();
        this.state = {
            inerval: ''
        }
    }


    componentDidMount() {
        this.setState({ interval: setInterval(this.listen4DB, 1000) })
    }

    handleClick = (args) => {
        console.log(args)
    }

    render() {

        // let renObjData = ''

        // if (this.props.response) {
        //     renObjData = this.props.response.items.map(function (data, idx) {
        //         return ([
        //             <li onClick={()=> this.handleClick()} key={idx}>{data.snippet.title}</li>,
        //         ]);
        //     });
        // }

        // let buildings = this.props.response.items


        return (
            <div className="Results">
                Results
                {this.props.response && <div>
                    <MediaPlayer
                        videoId={this.props.response.items[5].id.videoId}
                    />
                </div>}
                    {this.props.response &&
                        <ul className="Suit_Results">
                            {/* {renObjData} */}
                            <li onClick={()=> this.handleClick('asfsd')}>sadf</li>
                        </ul>}
            </div>
        )
    }

}

export default Results
